  `opportunity_id` int(11) DEFAULT '0' COMMENT '当前有效的商机Id',
  `merchant_user_id` int(11) DEFAULT '0' COMMENT '商户Id',
  `plugin_id` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '插件ID',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态，0为试用中，1为已收费，2为关闭,3为已过期',
  `operate_remark` text COLLATE utf8mb4_unicode_ci COMMENT '操作备注，如关闭备注',
  `business_id` int(11) NOT NULL DEFAULT '0' COMMENT '业务ID',
  `start_date` date NOT NULL COMMENT '服务开始时间',
  `end_date` date NOT NULL COMMENT '服务结束时间',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
