  `type` int(4) DEFAULT '0' COMMENT '默认:0,1:生成案例;2:不生成案例',
  `operate_id` int(11) DEFAULT NULL COMMENT '操作人',
  `operate_time` timestamp NULL DEFAULT NULL COMMENT '后台操作时间',
  `last_record_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后记录时间',
  `has_reward` int(4) DEFAULT '0' COMMENT '2:没有发奖，1:已发奖',
  `has_video` int(4) DEFAULT '0' COMMENT '0:没有,1:有',
  `transaction_id` int(11) DEFAULT '0' COMMENT '奖励id',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`,`plugin_id`),
  KEY `services_business_id_index_normal` (`business_id`) USING BTREE,
  KEY `services_sales_id_index_normal` (`sales_id`) USING BTREE,
  CONSTRAINT `fk_service_shop` FOREIGN KEY (`shop_id`) REFERENCES `shop` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='服务表';
