--
-- Table structure for table `transfer_requirement`
--

DROP TABLE IF EXISTS `transfer_requirement`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `transfer_requirement` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `requirement_id` int(11) NOT NULL DEFAULT '0' COMMENT '需求ID',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '类型，1为店铺转让，2为出租招商',
  `area` int(11) NOT NULL DEFAULT '0' COMMENT '面积',
  `rent` bigint(13) DEFAULT NULL COMMENT '租金',
  `cost` bigint(13) NOT NULL DEFAULT '0' COMMENT '转让费',
  `business_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '营业状态，1为营业中，2为未营业',
  `empty_transfer` tinyint(4) NOT NULL DEFAULT '2' COMMENT '是否空转，1为是，2为否',
  `negotiable` tinyint(1) DEFAULT '0' COMMENT '转让费是否可面议。0=不可面议；1=可面议；默认为0',
  `fingerprint` bigint(20) NOT NULL DEFAULT '0' COMMENT '指纹',
  `shop_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '店名',
  `industry_id` int(11) DEFAULT '0' COMMENT '行业Id',
  `district_id` int(11) DEFAULT '0' COMMENT '区域Id',
  `address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '地址',
  `latitude` double(10,6) DEFAULT '0.000000' COMMENT '纬度',
  `longitude` double(10,6) DEFAULT '0.000000' COMMENT '经度',
  PRIMARY KEY (`id`),
  UNIQUE KEY `requirement_id` (`requirement_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='转店需求表';
/*!40101 SET character_set_client = @saved_cs_client */;

